prompt --application/shared_components/plugins/region_type/apex_qr_code_scanner
begin
wwv_flow_api.create_plugin(
 p_id=>wwv_flow_api.id(15234259253354589554)
,p_plugin_type=>'REGION TYPE'
,p_name=>'APEX.QR.CODE.SCANNER'
,p_display_name=>'APEX QR Code Scanner'
,p_supported_ui_types=>'DESKTOP:JQM_SMARTPHONE'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'FUNCTION F_RENDER (',
'    P_REGION                IN APEX_PLUGIN.T_REGION,',
'    P_PLUGIN                IN APEX_PLUGIN.T_PLUGIN,',
'    P_IS_PRINTER_FRIENDLY   IN BOOLEAN',
') RETURN APEX_PLUGIN.T_REGION_RENDER_RESULT IS',
'BEGIN',
'    APEX_JAVASCRIPT.ADD_LIBRARY(',
'        P_NAME        => ''qrcodescanner.pkg.min'',',
'        P_DIRECTORY   => P_PLUGIN.FILE_PREFIX,',
'        P_VERSION     => NULL,',
'        P_KEY         => ''qrscanjssrc''',
'    );',
'',
'    APEX_JAVASCRIPT.ADD_ONLOAD_CODE( ''qrCodeScanner.initialize(''',
'       || APEX_JAVASCRIPT.ADD_VALUE( P_REGION.STATIC_ID, TRUE )',
'       || APEX_JAVASCRIPT.ADD_VALUE( P_REGION.ATTRIBUTE_01, TRUE )',
'       || APEX_JAVASCRIPT.ADD_VALUE( P_REGION.ATTRIBUTE_02, TRUE )',
'       || APEX_JAVASCRIPT.ADD_VALUE( P_REGION.ATTRIBUTE_03, TRUE )',
'       || APEX_JAVASCRIPT.ADD_VALUE( P_REGION.ATTRIBUTE_04, FALSE )',
'       || '');'' );',
'',
'    RETURN NULL;',
'END;'))
,p_api_version=>1
,p_render_function=>'F_RENDER'
,p_substitute_attributes=>true
,p_subscribe_plugin_settings=>true
,p_help_text=>wwv_flow_string.join(wwv_flow_t_varchar2(
'This Region Plug-in is used to scan QR Codes. If any string has been detected an APEX Item can be set, Dynamic Action can be fired or JavaScript can be executed.',
'',
'To control the QR Code Scanner you can fire events on th QR Code region.',
'',
'The following events are supportet:',
'',
'$("#qrscanner_region").trigger("scannerPause"); => Pause the scanner',
'$("#qrscanner_region").trigger("scannerPlay"); => Restart the scanner from pause',
'$("#qrscanner_region").trigger("resetValue"); => Reset value to rescan the same QR Code if needed',
'',
'Login for Demo is: user-demo / 123456@'))
,p_version_identifier=>'1.4'
,p_about_url=>'https://github.com/RonnyWeiss/APEX-QR-Code-Scanner'
,p_files_version=>1146
);
wwv_flow_api.create_plugin_attribute(
 p_id=>wwv_flow_api.id(15234259497924589559)
,p_plugin_id=>wwv_flow_api.id(15234259253354589554)
,p_attribute_scope=>'COMPONENT'
,p_attribute_sequence=>1
,p_display_sequence=>10
,p_prompt=>'ConfigJSON'
,p_attribute_type=>'JAVASCRIPT'
,p_is_required=>true
,p_default_value=>wwv_flow_string.join(wwv_flow_t_varchar2(
'{',
'  "height": 340,',
'  "scanFrameColor": "rgba(192,0,15,1)",',
'  "facingMode": "environment"',
'}'))
,p_supported_ui_types=>'DESKTOP:JQM_SMARTPHONE'
,p_is_translatable=>false
,p_help_text=>wwv_flow_string.join(wwv_flow_t_varchar2(
'<pre>',
'{',
'  "height": 340,',
'  "scanFrameColor": "rgba(192,0,15,1)",',
'  "facingMode": "environment"',
'}',
'</pre>',
'<br>',
'<h3>Explanation:</h3>',
'  <dl>',
'  <dt>height (number)</dt>',
'  <dd>height of the canvas</dd>',
'  <dl>',
'  <dt>scanFrameColor (string)</dt>',
'  <dd>color of the border frame when qr code had been detected</dd>',
'  <dl>',
'  <dt>facingMode(string)</dt>',
'  <dd>choose camera e.g. on mobile phones</dd>',
'  <dd>',
'  <ul>',
'  <li><b>"user"</b>: The video source is facing toward the user; this includes, for example, the front-facing camera on a smartphone.</li>',
'  <li><b>"environment"</b>: The video source is facing away from the user, thereby viewing their environment. This is the back camera on a smartphone.</li>',
'  <li><b>"left"</b>: The video source is facing toward the user but to their left, such as a camera aimed toward the user but over their left shoulder.</li>',
'  <li><b>"right"</b>: The video source is facing toward the user but to their right, such as a camera aimed toward the user but over their right shoulder.</li>',
'  </ul>'))
);
